#define X11_COLOR_COUNT 752

// Case-insensitive binary search for color name
static int x11_color_compare(const void *a, const void *b) {
    return strcasecmp((const char *)a, ((const X11Color *)b)->name);
}

const X11Color *lookup_x11_color(const char *name) {
    return bsearch(name, x11_colors, X11_COLOR_COUNT,
                   sizeof(X11Color), x11_color_compare);
}
